import React from 'react'
import {Link} from 'react-router-dom'

export default function NavBar() {
  return (
    <div className="flex">
      <Link>Home</Link>
      <Link>Projects</Link>
      <Link>Articles</Link>
      <Link>Contact</Link>
    </div>
  )
}
